import Header from "../components/Header";
import Footer from "../components/Footer";
import {Image} from "react-bootstrap";
import '../styles/home.css';

function Home() {
    return (
        <div className="App">
                <Header/>
            <div className='First-block'>
                <Image src='/assets/home-contactUs.png' fluid/>
                <Image src='/public/home-contactUs.png' fluid/>

                <img src=''/>
            </div>
                <Footer/>
        </div>
    );
}
export default Home;
